import LeftFoot from "./LeftFoot";
import CenterFoot from "./CenterFoot";
import RightFoot from "./RightFoot";
function IndexFootWeb()
{
    return(
        <>
         <div class="CuoiTrangSP">
            <div class="row">
                <LeftFoot/>
                <CenterFoot/>
                <RightFoot/>
            </div>
        </div>
        </>
    )
}

export default IndexFootWeb;
